import React from 'react';

function Experience() {
  return (
    <div>
      <h2>Welcome to My Portfolio</h2>
      <p>ChangePlusPlus, Software Developer</p>
      <br />
      <p>Generation Rise, Web Development Contractor</p>
      <br />
      <p>Medical-image Analysis and Statistical Interpretation Lab, Research Engineer </p>
    </div>
  );
}

export default Experience;
